    absatz2litt: "",     absatz2lituz: "",     absatz2litu: "",     absatz2litvz: "",     absatz2litv: "",     absatz2bisz: "",     absatz2bis: "",     absatz2bislitaz: "",     absatz2bislita: "",     absatz2bislitbz: "",     absatz2bislitb: "",     absatz2bislitcz: "",     absatz2bislitc: "",     absatz2bislitdz: "",     absatz2bislitd: "",     absatz2bislitez: "",     absatz2bislite: "",     absatz2terz: "",     absatz2ter: "",     absatz2quaterz: "",     absatz2quater: "",     absatz2quaterlitaz: "",     absatz2quaterlita: "",     absatz2quaterlitbz: "",     absatz2quaterlitb: "",     absatz2quaterlitcz: "",     absatz2quaterlitc: "",     absatz2quinquiesz: "",     absatz2quinquies: "",     absatz2sexiesz: "",     absatz2sexies: "",     absatz2septiesz: "",     absatz2septies: "",     absatz3z: "3",     absatz3: "    Die Frau, die ihre Schwangerschaft nach Ablauf der zwölften Woche seit Beginn der letzten Periode abbricht, abbrechen lässt oder sich in anderer Weise am Abbruch beteiligt, ohne dass die Voraussetzungen nach Artikel 119 Absatz 1 erfüllt sind, wird mit Freiheitsstrafe bis zu drei Jahren oder Geldstrafe bestraft.",     absatz3litaz: "",     absatz3lita: "",     absatz3litbz: "",     absatz3litb: "",     absatz3litcz: "",     absatz3litc: "",     absatz3litdz: "",     absatz3litd: "",     absatz3litdziffer1z: "",     absatz3litdziffer1: "",     absatz3litdziffer2z: "",     absatz3litdziffer2: "",     absatz3bisz: "",     absatz3bis: "",     absatz4z: "4",     absatz4: "    In den Fällen der Absätze 1 und 3 tritt die Verjährung in drei Jahren ein.",     absatz4litaz: "",     absatz4lita: "",     absatz4litaziffer1z: "",     absatz4litaziffer1: "",     absatz4litaziffer2z: "",     absatz4litaziffer2: "",     absatz4litbz: "",     absatz4litb: "",     absatz4litbziffer1z: "",     absatz4litbziffer1: "",     absatz4litbziffer2z: "",     absatz4litbziffer2: "",     absatz4litcz: "",     absatz4litc: "",     absatz4litdz: "",     absatz4litd: "",     absatz4b