    GesetzestextSTGBBT(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 138",     marginale1: "Veruntreuung",     marginale2: "",     absatz0: "1. Wer sich eine ihm anvertraute fremde bewegliche Sache aneignet, um sich oder einen andern damit unrechtmässig zu bereichern,\n\nwer ihm anvertraute Vermögenswerte unrechtmässig in seinem oder eines anderen Nutzen verwendet,\n\nwird mit Freiheitsstrafe bis zu fünf Jahren oder Geldstrafe bestraft.\n\nDie Veruntreuung zum Nachteil eines Angehörigen oder Familiengenossen wird nur auf Antrag verfolgt.\n\n2. Wer die Tat als Mitglied einer Behörde, als Beamter, Vormund, Beistand, berufsmässiger Vermögensverwalter oder bei Ausübung eines Berufes, Gewerbes oder Handelsgeschäftes, zu der er durch eine Behörde ermächtigt ist, begeht, wird mit Freiheitsstrafe bis zu zehn Jahren oder Geldstrafe bestraft.",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "",     absatz1: "",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lita: "",     absatz1litaziffer1z: "",     absatz1litaziffer1: "",     absatz1litaziffer2z: "",     absatz1litaziffer2: "",     absatz1litaziffer3z: "",     absatz1litaziffer3: "",     absatz1litabisz: "",     absatz1litabis: "",     marginaleabsatz1litb: "",     absatz1litbz: "",     absatz1litb: "",     absatz1litbziffer1z: "",     absatz1litbziffer1: "",     absatz1litbziffer2z: "",     absatz1litbziffer2: "",     absatz1litbzif