    GesetzestextSTGBBT(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 139",     marginale1: "Diebstahl",     marginale2: "",     absatz0: "1. Wer jemandem eine fremde bewegliche Sache zur Aneignung wegnimmt, um sich oder einen andern damit unrechtmässig zu bereichern, wird mit Freiheitsstrafe bis zu fünf Jahren oder Geldstrafe bestraft.\n\n2. Der Dieb wird mit Freiheitsstrafe bis zu zehn Jahren oder Geldstrafe nicht unter 90 Tagessätzen bestraft, wenn er gewerbsmässig stiehlt.\n\n3. Der Dieb wird mit Freiheitsstrafe von sechs Monaten bis zu zehn Jahren bestraft,\n\nwenn er den Diebstahl als Mitglied einer Bande ausführt, die sich zur fortgesetzten Verübung von Raub oder Diebstahl zusammengefunden hat,\n\nwenn er zum Zweck des Diebstahls eine Schusswaffe oder eine andere gefährliche Waffe mit sich führt oder\n\nwenn er sonst wie durch die Art, wie er den Diebstahl begeht, seine besondere Gefährlichkeit offenbart.\n\n4. Der Diebstahl zum Nachteil eines Angehörigen oder Familiengenossen wird nur auf Antrag verfolgt.",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "",     absatz1: "",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lita: "",     absatz1litaziffer1z: "",     absatz1litaziffer1: "",     absatz1litaziffer2z: "",     absatz1litaziffer2: "",     absatz1litaziffer3z: "",     absatz1litaziffer3: "",     absatz1litabisz: "",     absatz1litabis: "",     marginaleabsatz1li