    GesetzestextSTGBBT(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 140",     marginale1: "Raub",     marginale2: "",     absatz0: "1. Wer mit Gewalt gegen eine Person oder unter Androhung gegenwärtiger Gefahr für Leib oder Leben oder nachdem er den Betroffenen zum Widerstand unfähig gemacht hat, einen Diebstahl begeht, wird mit Freiheitsstrafe von sechs Monaten bis zu zehn Jahren bestraft.\n\nWer, bei einem Diebstahl auf frischer Tat ertappt, Nötigungshandlungen nach Absatz 1 begeht, um die gestohlene Sache zu behalten, wird mit der gleichen Strafe belegt.\n\n2. Der Räuber wird mit Freiheitsstrafe nicht unter einem Jahr bestraft, wenn er zum Zweck des Raubes eine Schusswaffe oder eine andere gefährliche Waffe mit sich führt.\n\n3. Der Räuber wird mit Freiheitsstrafe nicht unter zwei Jahren bestraft,\n\nwenn er den Raub als Mitglied einer Bande ausführt, die sich zur fortgesetzten Verübung von Raub oder Diebstahl zusammengefunden hat,\n\nwenn er sonst wie durch die Art, wie er den Raub begeht, seine besondere Gefährlichkeit offenbart.\n\n4. Die Strafe ist Freiheitsstrafe nicht unter fünf Jahren, wenn der Täter das Opfer in Lebensgefahr bringt, ihm eine schwere Körperverletzung zufügt oder es grausam behandelt.",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "",     absatz1: "",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lita: "",     absatz1litaziffer1z: "",     absatz