    GesetzestextSTGBBT(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 158",     marginale1: "Ungetreue Geschäftsbesorgung",     marginale2: "",     absatz0: "1. Wer aufgrund des Gesetzes, eines behördlichen Auftrages oder eines Rechtsgeschäfts damit betraut ist, Vermögen eines andern zu verwalten oder eine solche Vermögensverwaltung zu beaufsichtigen, und dabei unter Verletzung seiner Pflichten bewirkt oder zulässt, dass der andere am Vermögen geschädigt wird, wird mit Freiheitsstrafe bis zu drei Jahren oder Geldstrafe bestraft.\n\nWer als Geschäftsführer ohne Auftrag gleich handelt, wird mit der gleichen Strafe belegt.\n\nHandelt der Täter in der Absicht, sich oder einen andern unrechtmässig zu bereichern, so kann auf Freiheitsstrafe von einem Jahr bis zu fünf Jahren erkannt werden.\n\n2. Wer in der Absicht, sich oder einen andern unrechtmässig zu bereichern, die ihm durch das Gesetz, einen behördlichen Auftrag oder ein Rechtsgeschäft eingeräumte Ermächtigung, jemanden zu vertreten, missbraucht\n\n3. Die ungetreue Geschäftsbesorgung zum Nachteil eines Angehörigen oder Familiengenossen wird nur auf Antrag verfolgt. und dadurch den Vertretenen am Vermögen schädigt, wird mit Freiheitsstrafe bis zu fünf Jahren oder Geldstrafe bestraft.",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "",     absatz1: "",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lita: "",     absatz1litazif