    GesetzestextSTGBBT(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 165",     marginale1: "Misswirtschaft",     marginale2: "",     absatz0: "1. Der Schuldner, der in anderer Weise als nach Artikel 164, durch Misswirtschaft, namentlich durch ungenügende Kapitalausstattung, unverhältnismässigen Aufwand, gewagte Spekulationen, leichtsinniges Gewähren oder Benützen von Kredit, Verschleudern von Vermögenswerten oder arge Nachlässigkeit in der Berufsausübung oder Vermögensverwaltung,\n\nseine Überschuldung herbeiführt oder verschlimmert, seine Zahlungsunfähigkeit herbeiführt oder im Bewusstsein seiner Zahlungsunfähigkeit seine Vermögenslage verschlimmert,\n\nwird, wenn über ihn der Konkurs eröffnet oder gegen ihn ein Verlustschein ausgestellt worden ist,\n\n2. Der auf Pfändung betriebene Schuldner wird nur auf Antrag eines Gläubigers verfolgt, der einen Verlustschein gegen ihn erlangt hat.\n\nDer Antrag ist innert drei Monaten seit der Zustellung des Verlustscheines zu stellen.\n\nDem Gläubiger, der den Schuldner zu leichtsinnigem Schuldenmachen, unverhältnismässigem Aufwand oder zu gewagten Spekulationen verleitet oder ihn wucherisch ausgebeutet hat, steht kein Antragsrecht zu.",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "",     absatz1: "",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lita: "",     absatz1litaziffer1z: "",     absatz1litaziffer1: "",     absatz1litaziff